var isSubUwmA = false;
var urlParams;
var match,
		pl     = /\+/g,  // Regex for replacing addition symbol with a space
		search = /([^&=]+)=?([^&]*)/g,
		decode = function (s) { return decodeURIComponent(s.replace(pl, " ")); },
		query  = window.location.search.substring(1);

urlParams = {};
while (match = search.exec(query))
   urlParams[decode(match[1])] = decode(match[2]);

if (urlParams["u"]) {
	if (parseInt(urlParams["u"]) >= 0) {
		isSubUwmA = true;
	} 
};

var e = document.getElementById("constat");

var downImage = "data:image/gif;base64,";
//mp3 sound for conn status
var base64string = '';

function online(event) {
  if (isSubUwmA == true) {
	  return;
  }
  switch (event.type) {
	  case "online":
		alertify.success("Internet is up!", "", 0);
		e.src = "/static/img/statc.png";
		e.style.visibility = 'visible';
		var snd = Sound("data:audio/mp3;base64," + base64string);
		break;
	  case "offline":
		alertify.error("Internet is down!", "", 0);
		e.src = downImage; 
		var snd = Sound("data:audio/mp3;base64," + base64string);
		break;
  }
  
}

var Sound = (function () {
    var df = document.createDocumentFragment();
    return function Sound(src) {
        var snd = new Audio(src);
        df.appendChild(snd); // keep in fragment until finished playing
        snd.addEventListener('ended', function () {df.removeChild(snd);});
        snd.play();
        return snd;
    }
}());

addEvent(window, 'online', online);
addEvent(window, 'offline', online);
online({ type: 'ready' });

	